import React from 'react';
import { Divider } from '@material-ui/core';
import ThemeSwitcher from '../ThemeSwitcher';
import { Container, Logo } from './styles';

import ListMenu from './ListMenu';
import logo from '../../assets/react.png';

const Sidebar = () => (
  <>
    <Container>
      <Divider />
      <Logo>
        <img alt="logo" src={logo} />
      </Logo>
      <Divider />
      <ThemeSwitcher />
      <Divider />
      <div
        style={{
          zIndex: 999,
          backgraund: '#fff',
          display: 'flex',
          flexDirection: 'column',
          margin: '0 auto',
          flexWrap: 'wrap',
          justifyContent: 'spaceBetween',
        }}
      >
        <div
          style={{ background: '#7159c1', color: '#fff', padding: '0 10px' }}
        >
          <nav style={{ background: 'red', height: '100px' }}>Menu</nav>
          <aside style={{ background: 'green', height: '50px' }}>
            Configurações
          </aside>
        </div>
      </div>
    </Container>
  </>
);

export default Sidebar;
